new$Pixel_Rate,\n","  xlab = \"ROPs\", ylab = \"Pixel_Rate\",\n","  main = \"Pixel_Rate and ROPs\", col = \"blue\", pch = 20\n",")\n","fit3 <- lm(Pixel_Rate ~ ROPs, data = GPU_new)\n","abline(fit3, col = \"red\")\n","\n","# log(ROPs) vs log(Pixel_Rate)\n","plot(GPU_new_log$ROPs, GPU_new_log$Pixel_Rate,\n","  xlab = \"log(ROPs)\", ylab = \"log(Pixel_Rate)\",\n","  main = \"log(Pixel_Rate) and log(ROPs)\", col = \"red\", pch = 20\n",")\n","fit4 <- lm(Pixel_Rate ~ ROPs, data = GPU_new_log)\n","abline(fit4, col = \"blue\")\n","\n","# Shader vs Pixel_Rate\n","plot(GPU_new$Shader, GPU_new$Pixel_Rate,\n","  xlab = \"Shader\", ylab = \"Pixel_Rate\",\n","  main = \"Pixel_Rate and Shader\", col = \"blue\", pch = 20\n",")\n","fit5 <- lm(Pixel_Rate ~ Shader, data = GPU_new)\n","abline(fit5, col = \"red\")\n","\n","# log(Shader) vs log(Pixel_Rate)\n","plot(GPU_new_log$Shader, GPU_new_log$Pixel_Rate,\n","  xlab = \"log(Shader)\", ylab = \"log(Pixel_Rate)\",\n","  main = \"log(Pixel_Rate) and log(Shader)\", col = \"red\", pch = 20\n",")\n","fit6 <- lm(Pixel_Rate ~ Shader, data = GPU_new_log)\n","abline(fit6, col = \"blue\")"]},{"cell_type":"code","execution_count":24,"id":"44dfebd3","metadata":{"execution":{"iopub.execute_input":"2025-08-28T04:27:58.356566Z","iopub.status.busy":"2025-08-28T04:27:58.355103Z","iopub.status.idle":"2025-08-28T04:27:58.367962Z","shell.execute_reply":"2025-08-28T04:27:58.366332Z"},"papermill":{"duration":0.044839,"end_time":"2025-08-28T04:27:58.370564","exception":false,"start_time":"2025-08-28T04:27:58.325725","status":"completed"},"tags":[]},"outputs":[],"source":["# Reset layout\n","par(mfrow = c(1, 1))"]},{"cell_type":"markdown","id":"635f9f10","metadata":{"papermill":{"duration":0.030159,"end_time":"2025-08-28T04:27:58.428082","exception":false,"start_time":"2025-08-28T04:27:58.397923","status":"completed"},"tags":[]},"source":["# Thống kê suy diễn"]},{"cell_type":"markdown","id":"7baaae93","metadata":{"papermill":{"duration":0.028035,"end_time":"2025-08-28T04:27:58.484281","exception":false,"start_time":"2025-08-28T04:27:58.456246","status":"completed"},"tags":[]},"source":["## Chia dữ liệu, tạo biến dummy cho cả train và test cho mô hình 1"]},{"cell_type":"code","execution_count":25,"id":"a6d39113","metadata":{"execution":{"iopub.execute_input":"2025-08-28T04:27:58.54332Z","iopub.status.busy":"2025-08-28T04:27:58.541917Z","iopub.status.idle":"2025-08-28T04:27:58.578599Z","shell.execute_reply":"2025-08-28T04:27:58.576898Z"},"papermill":{"duration":0.06859,"end_time":"2025-08-28T04:27:58.580865","exception":false,"start_time":"2025-08-28T04:27:58.512275","status":"completed"},"tags":[]},"outputs":[],"source":["# Chia dữ liệu thành tập huấn luyện và tập kiểm tra (2/3 - 1/3)\n","set.seed(123)\n","index <- createDataPartition(GPU_new_log$Pixel_Rate, p = 2/3, list = FALSE)\n","train <- GPU_new_log[index, ]\n","test  <- GPU_new_log[-index, ]\n","\n","# Tạo biến dummy cho cả train và test cho mô hình 1\n","make_dummies <- function(df) {\n","df$ManufacturerNvidia <- ifelse(df$Manufacturer == \"Nvidia\", 1, 0)\n","df$Memory_TypeGDDR    <- ifelse(df$Memory_Type == \"GDDR\", 1, 0)\n","df$Resolution_WxH1    <- ifelse(df$Resolution_WxH == \"1\", 1, 0)\n","return(df)\n","}\n","\n","train1 <- make_dummies(train)\n","test1  <- make_dummies(test)"]},{"cell_type":"markdown","id":"3f78bd84","metadata":{"papermill":{"duration":0.029045,"end_time":"2025-08-28T04:27:58.636443","exception":false,"start_time":"2025-08-28T04:27:58.607398","status":"completed"},"tags":[]},"source":["## Đánh giá mối quan hệ giữa các biến bằng ma trận tương quan Pearson và Scatter plot và Scatter matrix"]},{"cell_type":"code","execution_count":26,"id":"41906936","metadata":{"execution":{"iopub.execute_input":"2025-08-28T04:27:58.699009Z","iopub.status.busy":"2025-08-28T04:27:58.697565Z","iopub.status.idle":"2025-08-28T04:27:58.731904Z","shell.execute_reply":"2025-08-28T04:27:58.729939Z"},"papermill":{"duration":0.066514,"end_time":"2025-08-28T04:27:58.