ain, var.equal = FALSE)\n","  print(welch)\n","  \n","} else {\n","  cat(\"→ Dùng Kruskal-Wallis\\n\")\n","  kruskal <- kruskal.test(as.formula(paste(\"Pixel_Rate ~\", cat)), data = train)\n","  print(kruskal)\n","  \n","  # Hậu nghiệm Dunn nếu cần\n","  dunn <- dunnTest(as.formula(paste(\"Pixel_Rate ~\", cat)), data = train, method = \"bonferroni\")\n","  print(dunn)\n","  \n","  dunn_df <- as.data.frame(dunn$res)\n","  barplot(\n","    height = dunn_df$Z,\n","    names.arg = dunn_df$Comparison,\n","    las = 2,\n","    col = ifelse(dunn_df$P.adj < 0.05, \"tomato\", \"skyblue\"),\n","    main = paste(\"Dunn Post-hoc -\", cat),\n","    ylab = \"Z value\")\n","}\n","}\n","par(mfrow = c(1, 1))"]},{"cell_type":"markdown","id":"bb562a46","metadata":{"papermill":{"duration":0.058622,"end_time":"2025-08-28T04:28:04.530403","exception":false,"start_time":"2025-08-28T04:28:04.471781","status":"completed"},"tags":[]},"source":["## Xây dựng mô hình hồi quy tuyến tính đa biến thứ nhất"]},{"cell_type":"code","execution_count":29,"id":"583c2459","metadata":{"execution":{"iopub.execute_input":"2025-08-28T04:28:04.639623Z","iopub.status.busy":"2025-08-28T04:28:04.638241Z","iopub.status.idle":"2025-08-28T04:28:04.722232Z","shell.execute_reply":"2025-08-28T04:28:04.719795Z"},"papermill":{"duration":0.136283,"end_time":"2025-08-28T04:28:04.72549","exception":false,"start_time":"2025-08-28T04:28:04.589207","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["        Core_Speed       Memory_Speed               ROPs               TMUs \n","          1.670728           3.511720           8.170173           8.061417 \n","        Memory_Bus             Memory            Process             Shader \n","          2.599436           3.024746           1.623418           1.822799 \n","ManufacturerNvidia    Memory_TypeGDDR    Resolution_WxH1 \n","          1.126551           2.284216           1.239314 \n"]},{"name":"stdout","output_type":"stream","text":