 dựng mô hình đa biến\n","model_final3 <- step_mod\n","print(summary(model_final3))"]},{"cell_type":"markdown","id":"54148703","metadata":{"papermill":{"duration":0.053934,"end_time":"2025-08-28T04:28:06.312745","exception":false,"start_time":"2025-08-28T04:28:06.258811","status":"completed"},"tags":[]},"source":["# Đánh giá và dự báo"]},{"cell_type":"markdown","id":"030fbefc","metadata":{"papermill":{"duration":0.054771,"end_time":"2025-08-28T04:28:06.421623","exception":false,"start_time":"2025-08-28T04:28:06.366852","status":"completed"},"tags":[]},"source":["## Đánh giá chỉ số MAE, MSE, R², RMSE"]},{"cell_type":"code","execution_count":34,"id":"a130d398","metadata":{"execution":{"iopub.execute_input":"2025-08-28T04:28:06.537044Z","iopub.status.busy":"2025-08-28T04:28:06.535359Z","iopub.status.idle":"2025-08-28T04:28:06.576711Z","shell.execute_reply":"2025-08-28T04:28:06.574814Z"},"papermill":{"duration":0.101486,"end_time":"2025-08-28T04:28:06.58026","exception":false,"start_time":"2025-08-28T04:28:06.478774","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["MAE trên tập kiểm tra: 0.1894203 \n"]},{"name":"stdout","output_type":"stream","text":["MSE trên tập kiểm tra: 0.07120416 \n"]},{"name":"stdout","output_type":"stream","text":["RMSE trên tập kiểm tra: 0.2668411 \n"]},{"name":"stdout","output_type":"stream","text":["R² trên tập kiểm tra: 0.9415654 \n"]}],"source":["# 6. Đánh giá và dự báo\n","#--------------------------------------------------\n","# 6.1 Dự báo trên tập test: MAE, MSE, R², RMSE\n","pred <- predict(model_final, newdata = test1)\n","test1$predicted_value <- pred\n","\n","# Tính toán các chỉ số\n","mae_value <- mae(test1$Pixel_Rate, test1$predicted_value)\n","mse_value <- mse(test1$Pixel_Rate, test1$predicted_value)\n","rmse_value <- rmse(test1$Pixel_Rate, test1$predicted_value)\n","r2_value <- cor(test1$Pixel_Rate, test1$predicted_value)^2\n","\n","cat(\"MAE trên tập kiểm tra:\", mae_value, \"\\n\")\n",